import React, { Component } from "react";

import Site from "./Site";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Home from "./components/Home";
function App() {
  return (
    <div className="App">
      <Header />
      <Home />
      <Site />
      <Footer />
    </div>
  );
}

export default App;
